import React from 'react'
const ColorPicker = () => {
  return (
    <>
        <label htmlFor='color'>Color: 
        <input type='text' id='color' className=' my-3' />
        <input type='submit' className='btn btn-primary' /></label>
    </>
  )
}

export default ColorPicker
